import React, { useState, useEffect } from "react";
import axios from "axios";
import LeagueAdminPage from "../components/LeagueAdminPage";

function LeagueAdmin() {
  const [data, setData] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:8000/api/league-admin/")
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      <LeagueAdminPage data={data} /> # refactor further by breaking down components 
    </div>
  );
}

export default LeagueAdmin;
